using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIStoryboard_Class/index.html#//apple_ref/occ/cl/UIStoryboard	/// <summary>	/// A UIStoryboard object encapsulates the view controller graph stored in an interface Builder storyboard resource file. This view controller graph represents the view controllers for all or part of your applicationâ€™s user interface. Normally, view controllers in a storyboard are instantiated and created automatically in response to actions defined within the storyboard itself. However, you can use a storyboard object to instantiate the initial view controller in a storyboard file or instantiate other view controllers that you want to present programmatically.	/// </summary>	[iOSVersion(5)]	public class UIStoryboard : NSObject	{		/// <summary>		/// Creates and returns a storyboard object for the specified storyboard resource file.		/// </summary>		/// <param name="name">The name of the storyboard resource file without the filename extension. This method raises an exception if this parameter is nil.</param>		/// <param name="bundle">The bundle containing the storyboard file and its related resources. If you specify nil, this method looks in the main bundle of the current application.</param>		/// <returns>A storyboard object for the specified file or nil if no such object exists.</returns>		[iOSVersion(5)]		public UIStoryboard(string name, NSBundle bundle) { }				/// <summary>		/// Instantiates and returns the initial view controller in the view controller graph.		/// </summary>		/// <returns>The initial view controller in the storyboard.</returns>		[iOSVersion(5)]		[Export("instantiateInitialViewController")]		public AnyObject InstantiateInitialViewController() { return null; }				/// <summary>		/// Instantiates and returns the view controller with the specified identifier.		/// </summary>		/// <param name="identifier">An identifier string that uniquely identifies the view controller in the storyboard file. You set the identifier for a given view controller in interface Builder when configuring the storyboard file. This identifier is not a property of the view controller object itself and is only used by the storyboard file to locate the view controller.   If the specified identifier does not exist (or is nil) in the storyboard file, this method raises an exception.</param>		/// <returns>The view controller corresponding to the specified identifier string or nil if no view controller is associated with the string.</returns>		[iOSVersion(5)]		[Export("instantiateViewControllerWithIdentifier")]		public AnyObject InstantiateViewControllerWithIdentifier(string identifier) { return null; }	}}